import React, { useEffect } from "react";

export const CartTotal = ({ userId }) => {
  useEffect(() => {
    setInterval(() => {
      getBasket(userId).then((data) => {
        setItems(data.basket.basketItem);
        setLoading(false);
      });
    }, 500);
  });
  return <div>CartTotal</div>;
};
